angular.module('app', ['components', 'google-maps']);

/** Converts numeric degrees to radians */
if (typeof(Number.prototype.toRad) === "undefined") {
  Number.prototype.toRad = function() {
    return this * Math.PI / 180;
  }
}
function tidesController($scope) {
  var centreLatLng = {
    latitude: -25.274398,
    longitude: 133.775136
  };
  var allPoints = latlons.map(function(point){ return convert(point)});
  $scope.latlon = centreLatLng.latitude+', '+centreLatLng.longitude;
  $scope.map = {
    center: centreLatLng,
    zoom: 3
  };
  $scope.nearestMarker = angular.extend({
    visible: true,
    draggable: false,
    icon: 'http://maps.google.com/mapfiles/ms/icons/green-dot.png'
  }, centreLatLng);
  $scope.marker = angular.extend({
	draggable: true,
	title:"Find tide times at this location",
	drag: function(arg){
	  $scope.$apply(function(){
	    var lat = arg.position.d;
	    var lng = arg.position.e;
	    var R = 6371; // km
	    function getDist(p1, index){
		var dLat = (p1.lat-lat).toRad();
		var dLon = (p1.lng-lng).toRad();
		var lat1 = lat.toRad();
		var lat2 = p1.lat.toRad();
		
		var a = Math.sin(dLat/2) * Math.sin(dLat/2) +
			Math.sin(dLon/2) * Math.sin(dLon/2) * Math.cos(lat1) * Math.cos(lat2); 
		var c = 2 * Math.atan2(Math.sqrt(a), Math.sqrt(1-a)); 
		var d = R * c;
	        return {
		  dist:d,
		  i:index,
		  lat: p1.lat,
		  lng: p1.lng
		};
	    }
	    var nearest = allPoints.map(getDist).sort(function(p1,p2){return p1.dist-p2.dist})[0];
	    $scope.latlon = 'nearest known times: '+ places[latlons[nearest.i]];
	    $scope.nearestMarker.latitude = nearest.lat;
	    $scope.nearestMarker.longitude = nearest.lng;
	  });
	}
    }, centreLatLng);
   //HTML5 geolocation - zoom to user's location
  if(navigator.geolocation) {
    navigator.geolocation.getCurrentPosition(function(position) {
      centreLatLng = {
	latitude: position.coords.latitude,
	longitude: position.coords.longitude
      };
      $scope.map.center = centreLatLng;
      $scope.map.zoom = 5;
      $scope.marker.latitude = centreLatLng.latitude;
      $scope.marker.longitude = centreLatLng.longitude;
    }, function(){
      //error getting location, just use default
    });
  }
  
}

